import React, { useState } from "react";
import * as Styled from "./styles";
import axios from "axios";

export const Dashboard = () => {
  const [searchValue, setSearchValue] = useState("");
  const [companyProfileValues, setCompanyProfileValues] = useState({});

  const onFormSubmit = (e) => {
    e.preventDefault();
    console.log("Form submit working", searchValue);

    getCompanyProfile();
  };

  const getCompanyProfile = () => {
    const TOKEN = `cbogg62ad3i94d2l9a30`;
    const API = `https://finnhub.io/api/v1/stock/profile2?symbol=${searchValue}&token=${TOKEN}`;

    try {
      axios.get(API).then((response) => {
        setCompanyProfileValues(response.data);
      });
    } catch (err) {
      console.log(err);
    }
  };

  const handleOnChange = (event) => {
    setSearchValue(event.target.value);
  };
  console.log(companyProfileValues);
  return (
    <Styled.Container>
      <form onSubmit={onFormSubmit}>
        <input placeholder="Company name" onChange={handleOnChange} />
        <button>Submit</button>
      </form>

      <div>
        {companyProfileValues &&
          companyProfileValues.map((companyProfile, index) => <div></div>)}
      </div>
    </Styled.Container>
  );
};
